import styles from "./BannerSecond.module.css"

const BannerSecond = () => {
    return(
        <div className={styles.BannerSecond_main}>
            <h2>Встречайте <br /> лето <br />вместе с нами</h2>
        </div>
    )
}

export default BannerSecond
